import React from "react";
import axios from "./../../axios";

class Chuck extends React.Component {
    state = {
        jokes: []
      }
      componentDidMount() {
        axios.get('fact')
        .then(response => {
          const jokes = response.data;
          this.setState ({jokes});

          
        })
        
      }
     render() {
      return (
        <ul>
               {
                  this.state.jokes
                     .map(person =>
                      <li >{person.data}</li>
                    )
               }
               </ul> 
      )}
}
export default Chuck

